コクがある味わいなので、お鍋はもちろん、〆まで美味しく食べられる鍋つゆシリーズです。<br>鰹・昆布・帆立・鶏の4つのだしを合わせた、あっさりしていてコクがある、寄せ鍋つゆです。<br>鰹・鶏・帆立・昆布の合わせだしでどんな具材にも合う味わいです。<br>〆はごはんを入れて旨みたっぷり雑炊を美味しくいただけます。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ミツカン<br>シリーズ名：〆まで美味しい<br>内容量：750g<br>原材料名：しょうゆ、果糖ぶどう糖液糖、米発酵調味料、食塩、米酢、かつお・そうだかつお混合だし、鶏がらだし、こんぶだし、ほたてだし、かつおだし、調味料(アミノ酸等)、アルコール、(原材料の一部に小麦を含む)<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4902106648758 SH5415 ミツカン みつかん 食品 しょくひん 鍋つゆ なべ 鍋 鍋スープ スープ 鍋の素 素 寄せ鍋つゆ よせなべ ストレート すとれーと ストレートつゆ 750g</font></td></tr></table><style type="text/css">
